\f1\b0\fs20 \cf0 \expnd0\expndtw0\kerning0 Equalizer distilles the expertise of three generations of parallel rendering APIs, delivering multi-view, resource aggregation and cluster-based execution. It provides the fastest porting path to create parallel, scalable OpenGL-based applications.\ The Equalizer API is a GLUT-like, minimally invasive parallel programming interface. Most of the application is unmodified, only the application's rendering code is plugged into the Equalizer framework for parallel execution.\ The application data structures, scene graph and rendering logics are unchanged and keep using the OpenGL hardware for maximum performance and compatibility.}
